import React from 'react';
import './Critter.css'

export const Critter = (props) => {
    return (
        <div>
        <div className="labelContainer">
                <p className="label">{props.label}</p>
        </div>
        <div className="critter">
            <img src={props.iconUri} alt="img"></img>
        </div>
        </div>
    )
}
